package bean;

public class cthdbean {
	private String macthd;
	private String mahang;
	private String tenhang;
	private String dungtich;
	private Long gia;
	private Long slmua;
	private Long thanhtien;
	private String anh;
	private String mahoadon;
	public cthdbean() {
		super();
		// TODO Auto-generated constructor stub
	}
	public cthdbean(String macthd, String mahang, String tenhang, String dungtich, Long gia, Long slmua, Long thanhtien,
			String anh, String mahoadon) {
		super();
		this.macthd = macthd;
		this.mahang = mahang;
		this.tenhang = tenhang;
		this.dungtich = dungtich;
		this.gia = gia;
		this.slmua = slmua;
		this.thanhtien = thanhtien;
		this.anh = anh;
		this.mahoadon = mahoadon;
	}
	public String getMacthd() {
		return macthd;
	}
	public void setMacthd(String macthd) {
		this.macthd = macthd;
	}
	public String getMahang() {
		return mahang;
	}
	public void setMahang(String mahang) {
		this.mahang = mahang;
	}
	public String getTenhang() {
		return tenhang;
	}
	public void setTenhang(String tenhang) {
		this.tenhang = tenhang;
	}
	public String getDungtich() {
		return dungtich;
	}
	public void setDungtich(String dungtich) {
		this.dungtich = dungtich;
	}
	public Long getGia() {
		return gia;
	}
	public void setGia(Long gia) {
		this.gia = gia;
	}
	public Long getSlmua() {
		return slmua;
	}
	public void setSlmua(Long slmua) {
		this.slmua = slmua;
	}
	public Long getThanhtien() {
		return thanhtien;
	}
	public void setThanhtien(Long thanhtien) {
		this.thanhtien = thanhtien;
	}
	public String getAnh() {
		return anh;
	}
	public void setAnh(String anh) {
		this.anh = anh;
	}
	public String getMahoadon() {
		return mahoadon;
	}
	public void setMahoadon(String mahoadon) {
		this.mahoadon = mahoadon;
	}
	
}
